import React from 'react';
import './app.css';
import { Switch, Route } from 'react-router-dom';
import {CardPage, MainPage} from "../pages";

const App = () => {
  return (
    <Switch>
      <Route path='/' exact>
        <MainPage />
      </Route>
      <Route path='/card-page'>
        <CardPage />
      </Route>
      <Route>

      </Route>
    </Switch>
  )
}

export default (App);
